import React from "react";
import "./Header.css";
import HeaderCartButton from "./HeaderCartButton";
import classes from './'

const Header = () => {
  return (
    <>
      <header className={classes.header}>
        <h1>React Meals</h1>
      </header>
      <div>
        <HeaderCartButton />
      </div>
    </>
  );
};

export default Header;
